script: |
  super -f text -I q652.spq | sort > q652.out

inputs:
  - name: q652.spq
    data: |
      SELECT DISTINCT - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT 2 * - - col1 + + 57 NOT BETWEEN ( + col0 ) AND - ( - CAST ( NULL AS REAL ) );
  - name: tab0

outputs:
  - name: q652.out
    data: |
